import {FiHome, FiSearch} from 'react-icons/fi'

export default function SideNav() {    
    const options = [
        {
            nome: 'Página Inicial',
            icone: FiHome 
        },
        {
            nome: 'Pesquisa',
            icone: FiSearch 
        },
        {
            nome: 'Explorar',
            icone: FiGlobe 
        },
    ]

    return (
        <div>
            <ul>
                {options.map((opt => {
                    <li key={opt.nome}>
                        <opt.icone/>
                        <h1>{opt.nome}</h1>
                    </li>
                }))}
            </ul>
        </div>
    )
}
